import "./basic.css";

let BasicJsx = () => {
  let fname = "Dinga";
  let lname = "Raja";
  let num = 12;
  let multiple = num * num;
  i

  let generateOtp = () => {
    let root = document.getElementsByClassName("hello");
    let a = Math.floor(Math.random() * 9000 + 1000);
    root.innerHTML = a;
  };

  // let b = setInterval(generateOtp, 1000);
  return (
    <>
      {/* Static Content */}
      <h1> Welcome to React class</h1>

      {/* Static with Dynamic Content */}
      <h3>
        My name is {fname} {lname}
      </h3>

      {/* Dynamic Content */}
      <h3>
        {num} * {num} = {num * num}
      </h3>
      <h3>
        {num} * {num} = {multiple}
      </h3>

      <button className="text-red" onClick={generateOtp}>
        {" "}
        Get OTP
      </button>
      <h1 className={"hello"}></h1>
    </>
  );
};
export default BasicJsx;
